      // disp_exitedColor: i18n.formatter.format("ExitedColor"), //

      value_displayModeList: [
        { value: "STANDARD", label: i18n.formatter.format("Standard") },
        { value: "COMPACT", label: i18n.formatter.format("Compact") }
      ],

      value_displayPhotoList: [
